/**
 *
 * @export
 * @interface DividendAtDate
 */
export interface DividendAtDate {
    [key: string]: any;
    /**
     * The ticker of the symbol that the dividend came from
     * @type {string}
     * @memberof DividendAtDate
     */
    'symbol'?: string | null;
    /**
     * The amount received from the dividend
     * @type {number}
     * @memberof DividendAtDate
     */
    'amount'?: number | null;
    /**
     * The currency of the amount
     * @type {string}
     * @memberof DividendAtDate
     */
    'currency'?: string;
}
